import React from "react";
import './Usercard.css'


const Usercard = ({user}) => {
    return (
        <>
            <div className="col-md-6">
                <img src={user.avatar_url} alt="Image" />
            </div>
            <div className="col-md-6">
                {user.login}
            </div>
        </>
    );
};

export default Usercard;
